import React,{Component} from 'react';
import Navbar from './Navbar';
import Rooms from './Rooms';
export default function Home(){
    return(
        <div style={{ backgroundImage: "url(/images/Home.png)", height: '100vh', backgroundSize: 'cover' }}>
            <Navbar></Navbar>
            <Rooms></Rooms>
        </div>
    )
}
